function set_div_width(objid,tdid){

    var testa=document.getElementById(objid);

    var tdid=document.getElementById(tdid);

    if(!testa)return;

    var par_div=testa.parentNode.children;

    var div_width=0;

    for(i=1;i < par_div.length;i++){

      if(!par_div[i].children[0]||!par_div[i].children[1])return;

      var temp_width=par_div[i].children[0].clientWidth+par_div[i].children[1].clientWidth;

      if(temp_width>div_width)div_width=temp_width;

      if(temp_width>438)par_div[i].children[1].style.width="349px";

    }

    if(div_width>438){

        //438

        testa.parentNode.children[0].style.width="438px";

    }else{

        //

        testa.parentNode.children[0].style.width=div_width+"px";

        tdid.style.width=div_width+"px";

    }

}

function handle_url(str){

    $re_string = "javascript:void(0)";

    if(str!=""){

        $re_string="http://"+str.replace('#dd#', '.dangdang.com/');

    }

    return $re_string ;

}

//

function is_have_sub(key){

    subnum = json_category[key].s.length ;

    subdate = json_category[key].s;

    for(i=0;i< subnum ;i++){

        subid = subdate[i] ;

        if(json_category[subid].s && json_category[subid].s.length>0){

            return 0;

        }

    }

    return 1;

}

//

function sub_combine(key){

    subnum = json_category[key].s.length ;

    subdate = json_category[key].s;

    var new_arr = new Array();

    var arr = new Array();

    for(i=0;i < subnum;i++){

        subid = subdate[i] ;

        group = json_category[subid].p;

        if(typeof(new_arr[group])=== 'undefined'){

            new_arr[group]=[];

        }

        new_arr[group].push(json_category[subid]);

    }

    //undefined

    for(i=0;i < new_arr.length;i++){

        if(new_arr[i]!=undefined){

            arr.push(new_arr[i]);

        }

    }

    //

    for(i=0;i < arr.length;i++){

        if(max_num < arr[i].length){

            max_num = arr[i].length;

        }

    }

    return arr;

}

//span

function get_span(len,max_num){

    var span_num = 0;

    var spanhtml = '';

    var group_max = 4;

    if(max_num<4)group_max=max_num;

    if(len < group_max){

        span_num = group_max - len;

    }else{

        is_double = len%group_max;

        if(is_double != 0){

            span_num = group_max-is_double;

        }

    }

    for(i=0;i < span_num;i++){

        spanhtml+='<span></span>';

    }

    return spanhtml;

}


